const Sidebar = () => {

  return (
    <div className="sidebar">
    <nav>
    <ul>
      <li><Link to="/profile"
      activeClass>Profile</Link></li>
      <li><Link to="/hello">Messages</Link></li>
      <li><Link to="/news">News</Link></li>
      <li><Link to="/hello">Music</Link></li>
      <li><Link to="/hello">Settings</Link></li>
    </ul>
    </nav>
  </div>
  )
}



export default Sidebar;
